import React from 'react';
import './App.scss';
import Header from "./header/Header";
import Wrapper from "./interactions/Wrapper";
import ApplicationUnitInfo from "./application/ApplicationUnitInfo";
import ApplicationBasicInfo from "./application/ApplicationBasicInfo";



class App extends React.Component {
    render() {

        return (
            <>
                <Wrapper/>
                <nav>
                    <Header/>
                </nav>
                <main>
                    {this.props.children}
                </main>
                <ApplicationUnitInfo/>
                <ApplicationBasicInfo/>
            </>
        );
    }
}


export default App;
